import React, { useState, useEffect } from 'react';
import Modal from './Modal';

const DB_Modal = ({ showModal, onCloseModal, URL, setShowInput, setHostileInfo, setPlaneData }) => {
    const [data, setData] = useState('Hello Modal');

    return (
        <Modal isOpen={showModal} onClose={onCloseModal} URL={URL} setShowInput={setShowInput} setHostileInfo={setHostileInfo} setPlaneData={setPlaneData}/>
    );
};

export default DB_Modal;
